import React from 'react';
import '../css/calendario.css';
import Calendarios from './Calendarios.js';
import YearInput from './yearinput.js';
import { getMonthsTitule } from '../utils/getMonthsTitule.js';
// Import the new Zustand store
import useCalendarStore from '../store/calendarStore';

function CardsCald() { 
  // TODO: Re-implement year handling with the new store.
  // const { setYearSet } = useCalendarStore(); // This function doesn't exist in the new store.
  const months = getMonthsTitule();

  const handleYearChange = (newYear) => {
    // setYearSet(newYear); // TODO: This needs a new implementation.
    console.log("Year changed to:", newYear); // Placeholder
  };

  return (
    <div className="calendar-container">
      <div className="year-selector">
        <YearInput onYearChange={handleYearChange} />
      </div>
      <div className="calendar-grid">
        {months.map((mes, index) => (
          <div className="month-card" key={mes}>
            <div className="month-header">
              <h5 className="month-title">{mes}</h5>
            </div>
            <div className="calendar-wrapper">
              <Calendarios monthCalendario={index} />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default CardsCald;
